## Rota responsável por criar um novo usuário

## Parâmetros:

-Não é necessário o envio de parâmetros nessa rota

## Responses

### 200 - OK
```json
{
	"id": "702b8167-d6ad-49b2-bb36-43eb6fb71bb9",
	"email": "mateus@mail.com",
	"name": "mateus",
	"superUser": false,
	"phone": "123214",
	"createdAt": "2024-02-05T20:45:45.581Z",
	"updatedAt": "2024-02-05T20:45:45.581Z",
	"updatedBy": null
}
```

### 400 - Bad Request
```json
{
{
	"message": "Bad Request",
	"fieldErrors": {
		"phone": [
			"Required"
		]
	}
}
}
```

### 409 - Conflict
```json
{
	"message": "Email and phone already exist"
}
```
